  `project_spelling` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `time_a` double(5,1) DEFAULT NULL,
  `time_b` double(5,1) DEFAULT NULL,
  `time_c` double(5,1) DEFAULT NULL,
  `time_d` double(5,1) DEFAULT NULL,
  `time_e` double(5,1) DEFAULT NULL,
  `remark` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`project_number`),
  UNIQUE KEY `uix_time_overview_project_number` (`project_number`),
  KEY `time_overview_remark_remark_remark_number_foreign` (`remark`),
  CONSTRAINT `time_overview_remark_remark_remark_number_foreign` FOREIGN KEY (`remark`) REFERENCES `remark` (`remark_number`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

